import "./AddUser.css"

const AddUser = props => {
    return (
        <form>
            <label for='username' >UserName</label>
            <input id="username" name='username' type="text" />
            <label for='age' >Age (Years)</label>
            <input id="age" name='age' type="number" min="0" />
            <button>Add User</button>
        </form>
    )
}

export default AddUser
